(473, 142, 'wpsm_accordion_data', 's:2117:\"a:4:{i:0;a:4:{s:15:\"accordion_title\";s:14:\"What is Phyton\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:3:\"yes\";s:14:\"accordion_desc\";s:331:\"Python is a versatile and high-level programming language known for its simplicity and readability. It is widely used in various domains, including web development, data science, artificial intelligence, scientific computing, and more. Pythons clean and expressive syntax makes it easy for developers to write and maintain code.\";}i:1;a:4:{s:15:\"accordion_title\";s:14:\"What is Kotlin\";s:20:\"accordion_title_icon\";s:8:\"fa-apple\";s:18:\"enable_single_icon\";s:3:\"yes\";s:14:\"accordion_desc\";s:295:\"Kotlin is a modern, statically-typed programming language developed by JetBrains. It is designed to be fully interoperable with Java and is often used for Android app development. Kotlin aims to improve upon some of Javas limitations by providing a more concise, expressive, and safer syntax.\";}i:2;a:4:{s:15:\"accordion_title\";s:13:\"What is Swift\";s:20:\"accordion_title_icon\";s:12:\"fa-ambulance\";s:18:\"enable_single_icon\";s:3:\"yes\";s:14:\"accordion_desc\";s:383:\"Swift is a powerful and modern programming language developed by Apple. It is primarily used for developing applications across the Apple ecosystem, including iOS, macOS, watchOS, and tvOS. Swift is designed with a focus on performance, safety, and ease of use. It offers concise and expressive syntax, which makes it more readable and maintainable than its predecessor, Objective-C.\";}i:3;a:4:{s:15:\"accordion_title\";s:15:\"What is Laravel\";s:20:\"accordion_title_icon\";s:6:\"fa-adn\";s:18:\"enable_single_icon\";s:3:\"yes\";s:14:\"accordion_desc\";s:438:\"Laravel is a popular open-source PHP web application framework known for its elegance and developer-friendly features. It simplifies the process of building robust and scalable web applications by providing a structured and expressive syntax. Laravel includes a wide range of built-in tools and libraries for common tasks like routing, authentication, database management, and more, reducing development time and promoting best practices.\";}}\";'),
(474, 142, 'wpsm_accordion_count', '4');
