(23, 1, '2023-10-06 16:21:03', '2023-10-06 16:21:03', '<!-- wp:paragraph -->\n<p>Bootstrap is a popular open-source front-end framework for web development. It provides a collection of pre-designed HTML, CSS, and JavaScript components and templates that help developers create responsive and visually appealing websites and web applications quickly and efficiently. Bootstrap\'s components include navigation bars, buttons, forms, modals, and more, making it easy to build modern and consistent user interfaces. It also offers a responsive grid system, which ensures that web content adapts seamlessly to various screen sizes and devices. Bootstrap simplifies the development process and helps maintain a cohesive design across different parts of a website or application.</p>\n<!-- /wp:paragraph -->', 'Bootstrap', 'These are bootstrap tutorials', 'inherit', 'closed', 'closed', '', '21-revision-v1', '', '', '2023-10-06 16:21:03', '2023-10-06 16:21:03', '', 21, 'http://localhost/wordpress/?p=23', 0, 'revision', '', 0),
(24, 1, '2023-10-06 16:22:35', '2023-10-06 16:22:35', '<!-- wp:paragraph -->\n<p>JavaScript is a versatile and widely-used programming language primarily employed in web development. It allows developers to add interactivity, manipulate web page content, and respond to user actions within web browsers. JavaScript is essential for creating dynamic and engaging web applications by enabling tasks such as form validation, animations, real-time updates, and more. It is a client-side scripting language, meaning it runs in the user\'s browser, reducing the need for constant communication with the web server. JavaScript can also be used on the server-side, thanks to technologies like Node.js, making it a powerful tool for full-stack web development.</p>\n<!-- /wp:paragraph -->', 'Javascript', 'These are javascript tutorials', 'publish', 'open', 'open', '', 'javascript', '', '', '2023-10-06 16:22:35', '2023-10-06 16:22:35', '', 0, 'http://localhost/wordpress/?p=24', 0, 'post', '', 0),
